import React from "react";
import { useState } from 'react';
import { Link } from 'react-router-dom';
import { makeStyles } from "@material-ui/core/styles";
import { FaLinkedin } from 'react-icons/fa';
import Listt from './list';
import Stack from '@mui/material/Stack';
import SendIcon from '@mui/icons-material/Send';
import { styled } from '@mui/material/styles';
import { TypeAnimation } from 'react-type-animation';
import { green } from '@mui/material/colors';
import imageList1 from './imageList';
import breadc from './breadc';
import mt from './MT.svg';
import mth from './mth.svg';
import ok from './ok22.svg';
import { emphasize } from '@mui/material/styles';
import Breadcrumbs from '@mui/material/Breadcrumbs';
import Chip from '@mui/material/Chip';
import HomeIcon from '@mui/icons-material/Home';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';




import { AppBar, Toolbar, Typography, Button, Grid, Paper } from "@material-ui/core";



const StyledBreadcrumb = styled(Chip)(({ theme }) => {
  const backgroundColor =
    theme.palette.mode === 'light'
      ? theme.palette.grey[100]
      : theme.palette.grey[800];
  return {
    backgroundColor,
    height: theme.spacing(3),

    color: theme.palette.text.primary,
    fontWeight: theme.typography.fontWeightRegular,
    '&:hover, &:focus': {
      backgroundColor: emphasize(backgroundColor, 0.06),
    },
    '&:active': {
      boxShadow: theme.shadows[1],
      backgroundColor: emphasize(backgroundColor, 0.12),
    },
    '&.differentColor': {
      backgroundColor: 'green', // Your desired different color
      color: 'white', // Text color for the different color breadcrumb
      '&:hover, &:focus': {
        backgroundColor: 'darkgreen', // Change background color on hover/focus
      },
      '& .MuiSvgIcon-root': {
        fill: 'white', // Icon color for the different color breadcrumb
      },
    },
  };
}); // TypeScript only: need a type cast here because https://github.com/Microsoft/TypeScript/issues/26591

function handleClick(event) {
  event.preventDefault();
  console.info('You clicked a breadcrumb.');
}
const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },

  appBar: {
    backgroundColor: theme.palette.background.paper,
    // borderBottom: "1px solid pink", 
