  },
  title: {
    flexGrow: 1,
    paddingLeft: '50%',
    fontWeight: "bold",
    color: "black",
    fontFamily: 'Montserrat',

  },
  container: {
    position: 'absolute', // Position the SVG absolutely within its container
    right: '600px', // Adjust this value for the desired right margin
    top: '50%', // Center the SVG vertically
    transform: 'translateY(-50%)', // Adjust to vertically center the SVG
    maxWidth: '100%', // Adjust the maximum width as needed
    height: 'auto', // Maintain the aspect ratio
  },
  svgImage: {
    marginTop: -200,
    marginLeft: 1000,
    maxWidth: 2000, // Make sure SVG doesn't exceed container width
    height: 'auto', // Maintain aspect ratio
  },
  summarySection: {
    marginTop: 100,
    marginLeft: 50,
    padding: theme.spacing(3),
    fontFamily: 'Montserrat',
    fontSize: 120,
    fontWeight: 20,
    animation: "type 4s steps(60, end)",

  },
  logoButton: {
    marginRight: theme.spacing(2),
    position: 'absolute',
    width: '110px',
    height: '110px',
  },
  top: {
    // marginTop: 275,
    // marginLeft: 305,
    marginLeft: 105,
    marginTop: 275,
    padding: theme.spacing(2),
    fontFamily: 'Montserrat',
    fontSize: 24,
    width: 700,
    fontWeight: 20,
    animation: "type 4s steps(60, end)",

  },
  bottom: {
    marginLeft: 100,
  },
  comment: {
    marginTop: -600,
    marginLeft: 700,
    padding: theme.spacing(1),
    fontFamily: 'Montserrat',
    fontSize: 30,
    fontWeight: 20,

  },
  interactiveArt: {
    marginTop: -70,
    width: 100,
    height: '100%',
  },
  linkedinButton: {
    marginTop: -3,
    left: 900,

  },
  svgc: {
    marginTop: -50,
    marginLeft: 450,
    width: '100px',
    height: '100px',

    /* Add more styling as needed */
