  bottom:{
    marginTop: 15,
    marginLeft: 115,
    fontFamily: 'Montserrat',
  },
  greenBreadcrumb: {
    backgroundColor: 'green', // Set the background color to green
    color: 'white', // Set the text color to white or another suitable color
    '&:hover, &:focus': {
      backgroundColor: 'darkgreen', // Change background color on hover/focus
    },
    '& .MuiSvgIcon-root': {
      fill: 'white', // Set the icon color to white
    },
  },
}));

const Homepage = () => {
  const classes = useStyles();

  const [linkedinUrl] = useState('https://www.linkedin.com/in/micatonge');

  const handleLinkedinClick = () => {
    window.open(linkedinUrl, '_blank');
  };

  const MoreSkillsList = ({ onClose }) => {
    const skills = ["Node.js", "Java", "HTML/CSS", "Design"];

    return (
      <List>
        {skills.map((skill) => (
          <ListItem button key={skill}>
            <ListItemText primary={skill} />
          </ListItem>
        ))}
      </List>
    );
  };

  const Homepage = () => {
    const [anchorEl, setAnchorEl] = useState(null);

    const handleClick = (event) => {
      setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
      setAnchorEl(null);
    };

    const open = Boolean(anchorEl);


  const ColorButton = styled(Button)(({ theme }) => ({
    color: theme.palette.getContrastText(green[700]),
    marginTop: 30,
    marginLeft: 120,
    fontFamily: 'Roboto',

    backgroundColor: green[700],
    '&:hover': {
      backgroundColor: green[800],
    },
  }));

  return (

    <div className={classes.root}>
      <AppBar position="static" className={classes.appBar}>
        <Toolbar >
          <Button component={Link} to="/"> <img src={mt} alt="Logo" className={classes.logoButton} /></Button>
          <Button className={classes.links} component={Link} to="/about">About Me</Button>
          <Button className={classes.links} component={Link} to="/projects">Projects</Button>
          <Button className={classes.links} component={Link} to="/resume">Resume</Button>
          <Button className={classes.links} component={Link} to="/contact">Contact Me</Button>
          <Button className={classes.linkedinButton} onClick={handleLinkedinClick}>
            <FaLinkedin size={20} />
          </Button>
          {/* <Typography variant="h6" className={classes.title}>
            Mica Tongemt
          </Typography> */}
        </Toolbar>
      </AppBar>
      <Grid container>
        <Grid item xs={12} md={10}>
        <div className={classes.svgc}>
        <img src={mth} alt="SVG Image" />
        </div>
            <Typography  className={classes.top} variant="h6">Brooklyn-based Software Engineer passionate about the blend of Computer Science and Design. âœ»</Typography>
        {/* <div role="presentation" onClick={handleClick} className={classes.bottom}>
      <Breadcrumbs aria-label="breadcrumb">
